import React, {useState} from "react";
import Home from "./PortfolioContainer/Home/Home";
import Projects from "./PortfolioContainer/Projects/Projects";


import "./App.css";

function App() {
  const [page, setHomePage] = useState()

  const homePageHelper = () => {

      if(page === "Home") {
          setHomePage("Home")
      }

    // page === "Home" ? homePageHelper("Projects") : homePageHelper("Home")
    // console.log(page)
  }

    const [projectPage, setProjectsPage] = useState()

    const projectsPageHelper = () => {
        if(page === "Projects") {
            setHomePage("Projects")
        }
    }



  return (
      <>
        <button onClick={() => homePageHelper()}>Home</button>
        <button onClick={() => projectsPageHelper()}>Projects</button>

        <div className="App">
          {page === "Home"}{< Home />}
          {page === "Projects"}{<Projects />}
        </div>
      </>
  )
}

export default App;
